const Zines = ({ zines }) => {
  return (
    <div>
      <h2>Zines</h2>
      <ul>
        {zines &&
          zines.map((zine) => (
            <li key={zine.id}>
              <h3>{zine.title}</h3>
              <p>{zine.description}</p>
              <h4>Images:</h4>
              <ul>
                {zine.images &&
                  zine.images.map((image) => <li key={image}>{image}</li>)}
              </ul>
            </li>
          ))}
      </ul>
    </div>
  );
};

export default Zines;
